  "translationLines": [
    {
      "lineNumber": 159661,
      "originalJapaneseLine": "「ははっ……本当に強いやこりゃ……」",
      "translatedEnglishLine": "\"Haha... She's really strong, this one...\""
    },
    {
      "lineNumber": 159662,
      "originalJapaneseLine": "「ああっ！　まったくだ！",
      "translatedEnglishLine": "\"Yeah! Exactly!"
    },
    {
      "lineNumber": 159663,
      "originalJapaneseLine": "　お前ら、満足はしたか！？」",
      "translatedEnglishLine": "Are you guys satisfied?!\""
    },
    {
      "lineNumber": 159664,
      "originalJapaneseLine": "「ああ、悪くなかったんじゃない？」",
      "translatedEnglishLine": "\"Yeah, I don't think it was bad.\""
    },
    {
      "lineNumber": 159665,
      "originalJapaneseLine": "「ぐへへぇ……これ以上を望んだら",
      "translatedEnglishLine": "\"Hehehe... If I asked for anything more"
    },
    {
      "lineNumber": 159666,
      "originalJapaneseLine": "　バチが当たるってもんでさぁ……",
      "translatedEnglishLine": "I'd probably get what's coming to me...\""
    },
    {
      "lineNumber": 159667,
      "originalJapaneseLine": "　良い一時をもらいやした……」",
      "translatedEnglishLine": "\"I had a really good time...\""
    },
    {
      "lineNumber": 159668,
      "originalJapaneseLine": "「ギャハッ！　楽シ！　楽シ、カッタ！",
      "translatedEnglishLine": "\"Gyaha! Fun! It was fun!"
    },
    {
      "lineNumber": 159669,
      "originalJapaneseLine": "　満足！　満足！」",
      "translatedEnglishLine": "Satisfied! Satisfied!\""
    },
    {
      "lineNumber": 159670,
      "originalJapaneseLine": "「わーーはっはっはっはっはっ！」",
      "translatedEnglishLine": "\"Wahaha hahahahaha!\""
    },
    {
      "lineNumber": 159671,
      "originalJapaneseLine": "「儂もだよ……」",
      "translatedEnglishLine": "\"Me too...\""
    },
    {
      "lineNumber": 159672,
      "originalJapaneseLine": "満足げに頬を歪めたかと思うと、",
      "translatedEnglishLine": "Just as he twisted his cheeks in satisfaction,"
    },
    {
      "lineNumber": 159673,
      "originalJapaneseLine": "レキシントンは大の字に倒れた。",
      "translatedEnglishLine": "Lexington fell down flat on his back."
    },
    {
      "lineNumber": 159674,
      "originalJapaneseLine": "「がははは！　俺様の大勝利ー！」",
      "translatedEnglishLine": "\"Gahaha! My great victory!\""
    },
    {
      "lineNumber": 159675,
      "originalJapaneseLine": "「はあはあ……こ、怖かったです……」",
      "translatedEnglishLine": "\"Haa haa... I-it was scary...\""
    },
    {
      "lineNumber": 159676,
      "originalJapaneseLine": "「って、あーーーーー！」",
      "translatedEnglishLine": "\"Wait, ahhhhh!\""
    },
    {
      "lineNumber": 159677,
      "originalJapaneseLine": "「ひゃっ！？　ら、ランス様！？",
      "translatedEnglishLine": "\"Hya!? L-Lord Rance!?\""
    },
    {
      "lineNumber": 159678,
      "originalJapaneseLine": "　どうしました！？」",
      "translatedEnglishLine": "What happened!?\""
    },
    {
      "lineNumber": 159679,
      "originalJapaneseLine": "「勢い余って殺してしまったー！？",
      "translatedEnglishLine": "\"Did I go too far and kill him?!"
    },
    {
      "lineNumber": 159680,
      "originalJapaneseLine": "　犯すつもりだったのにー！」",
      "translatedEnglishLine": "I was planning to violate him!\""
    },
    {
      "lineNumber": 159681,
      "originalJapaneseLine": "「ら、ランス様ぁ……」",
      "translatedEnglishLine": "\"L-Lord Rance...\""
    },
    {
      "lineNumber": 159682,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 159683,
      "originalJapaneseLine": "　　＜ぷしゅーーーーーーー……＞",
      "translatedEnglishLine": "<Pshuuuuuuuu...>"
    },
    {
      "lineNumber": 159684,
      "originalJapaneseLine": "「おお、なんだ！？　突然煙が！」",
      "translatedEnglishLine": "\"Oh, what is that!? Suddenly smoke!\""
    },
    {
      "lineNumber": 159685,
      "originalJapaneseLine": "レキシントンの体から大量の白煙が噴き出した。",
      "translatedEnglishLine": "A large amount of white smoke spewed from Lexington's body."
    },
    {
      "lineNumber": 159686,
      "originalJapaneseLine": "視界が晴れた頃、現れたのは――",
      "translatedEnglishLine": "When the smoke cleared, what appeared was—"
    },
    {
      "lineNumber": 159687,
      "originalJapaneseLine": "「げっ、おっさんの鬼……！」",
      "translatedEnglishLine": "\"Geh, an old man's demon...!\""
    },
    {
      "lineNumber": 159688,
      "originalJapaneseLine": "「あー、うん、これこれ。",
      "translatedEnglishLine": "\"Ah, yeah, this is it."
    },
    {
      "lineNumber": 159689,
      "originalJapaneseLine": "　見慣れた姿になったわい」",
      "translatedEnglishLine": "He's back to his familiar form.\""
    },
    {
      "lineNumber": 159690,
      "originalJapaneseLine": "「うーーーむ……",
      "translatedEnglishLine": "\"Uuuuum..."
    },
    {
      "lineNumber": 159691,
      "originalJapaneseLine": "　さすがにこの姿を見ると、萎えるな……」",
      "translatedEnglishLine": "Seeing him like this really takes the wind out of my sails...\""
    },
    {
      "lineNumber": 159692,
      "originalJapaneseLine": "「……この馬鹿が」",
      "translatedEnglishLine": "\"...That idiot.\""
    },
    {
      "lineNumber": 159693,
      "originalJapaneseLine": "「お、魔血魂になった。",
      "translatedEnglishLine": "\"Oh, it turned into a Magic Blood Soul."
    },
    {
      "lineNumber": 159694,
      "originalJapaneseLine": "　じゃあこれは持って帰るか」",
      "translatedEnglishLine": "Then let's take this back.\""
    },
    {
      "lineNumber": 159695,
      "originalJapaneseLine": "「そうは問屋のおろし金〜♪」",
      "translatedEnglishLine": "\"No way, that won't happen~♪\""
    },
    {
      "lineNumber": 159696,
      "originalJapaneseLine": "「なっ！？",
      "translatedEnglishLine": "\"Wha!?\""
    },
    {
      "lineNumber": 159697,
      "originalJapaneseLine": "ランスが魔血魂に手を伸ばすより一瞬早く、",
      "translatedEnglishLine": "Just before Rance reached out to the Magic Blood Soul,"
    },
    {
      "lineNumber": 159698,
      "originalJapaneseLine": "アトランタがレキシントンの魔血魂を掴んだ。",
      "translatedEnglishLine": "Atlanta grabbed Lexington's Magic Blood Soul."
    },
    {
      "lineNumber": 159699,
      "originalJapaneseLine": "「これは奪われるわけにはいかないのよね〜」",
      "translatedEnglishLine": "\"I can't let this be stolen~\""
    },
    {
      "lineNumber": 159700,
      "originalJapaneseLine": "「よし、次はもっと美しい奴に飲ませようか」",
      "translatedEnglishLine": "\"Alright, next let's have a more beautiful one drink this.\""
    },
    {
      "lineNumber": 159701,
      "originalJapaneseLine": "「なぁに言ってんの、",
      "translatedEnglishLine": "\"What are you saying,"
    },
    {
      "lineNumber": 159702,
      "originalJapaneseLine": "　次はもっと悪そうな奴に――」",
      "translatedEnglishLine": "next let's give it to someone who looks more wicked--\""
    },
    {
      "lineNumber": 159703,
      "originalJapaneseLine": "「ああ、やだやだ。これだから巨乳は……",
      "translatedEnglishLine": "\"Ugh, I hate this. This is why I can't stand big boobs..."
    },
    {
      "lineNumber": 159704,
      "originalJapaneseLine": "　いいか？　だいたい今回だって――」",
      "translatedEnglishLine": "Listen, even this time—\""
    },
    {
      "lineNumber": 159705,
      "originalJapaneseLine": "二人はわいわいと喧嘩しながら去って行った。",
      "translatedEnglishLine": "The two left, bickering loudly as they went."
    },
    {
      "lineNumber": 159706,
      "originalJapaneseLine": "「あ、あ……」",
      "translatedEnglishLine": "\"Ah, ah...\""
    },
    {
      "lineNumber": 159707,
      "originalJapaneseLine": "「ふぅー、じゃあ俺らも帰るかー。",
      "translatedEnglishLine": "\"Phew, then let's go home too."
    },
    {
      "lineNumber": 159708,
      "originalJapaneseLine": "　おら、みんな撤収ー」",
      "translatedEnglishLine": "Alright, everyone, retreat!\""
    },
    {
      "lineNumber": 159709,
      "originalJapaneseLine": "「アァーーハハハ、楽シ、楽シ！」",
      "translatedEnglishLine": "\"Aah-ha ha ha! Fun, fun!\""
    },
    {
      "lineNumber": 159710,
      "originalJapaneseLine": "鬼達は傷を手で押さえながらも、",
      "translatedEnglishLine": "The demons, holding their wounds with their hands,"
    },
    {
      "lineNumber": 159711,
      "originalJapaneseLine": "足取りは軽くゾロゾロと歩いて帰っていった。",
      "translatedEnglishLine": "walked off in a lively manner, one after another."
    },
    {
      "lineNumber": 159712,
      "originalJapaneseLine": "「い、行っちまい――」",
      "translatedEnglishLine": "\"T-they've gone—\""
    },
    {
      "lineNumber": 159713,
      "originalJapaneseLine": "「ましたね……」",
      "translatedEnglishLine": "\"They have...\""
    },
    {
      "lineNumber": 159714,
      "originalJapaneseLine": "「なんなんだ、あいつらはーーー！」",
      "translatedEnglishLine": "\"What the hell were those guys—!\""
    },
    {
      "lineNumber": 159715,
      "originalJapaneseLine": "「なんだったんでしょうね……」",
      "translatedEnglishLine": "\"I wonder who they really were...\""
    },
    {
      "lineNumber": 159716,
      "originalJapaneseLine": "リーザス陣地――",
      "translatedEnglishLine": "Leazas territory—"
    },
    {
      "lineNumber": 159717,
      "originalJapaneseLine": "「おおっ！　ランス殿がやってくれたか！」",
      "translatedEnglishLine": "\"Oh! Lord Rance did it!\""
    },
    {
      "lineNumber": 159718,
      "originalJapaneseLine": "「すごい！　本当にやってくれたんだ！」",
      "translatedEnglishLine": "\"Amazing! He really did it!\""
    },
    {
      "lineNumber": 159719,
      "originalJapaneseLine": "「ああ、これでリーザスが取り戻せるぞ！」",
      "translatedEnglishLine": "\"Yeah, now we can take back Leazas!\""
    },
    {
      "lineNumber": 159720,
      "originalJapaneseLine": "公園坂森の入り口に作られた",
      "translatedEnglishLine": "Built at the entrance of Koen Sakamori"
    }
  ]
}

